import React from 'react'

class Header extends React.Component {
    constructor() {
  super();
  this.state = {
        open: false
    };
}
handleClick() {
this.setState({
        open: !this.state.open
    });
}
render() {
    return (
      <HamburgerMenu
      isOpen={this.state.open}
      menuClicked={this.handleClick.bind(this)}
      width={100}
            height={80}
            strokeWidth={3}
            rotate={0}
      color='black'
            borderRadius={0}
      animationDuration='0.5'
    />
    );
}
};

export default Header;
